//Issues.js
import React from 'react';

const Issues = () => {
  return (
    <div>
      <h1>Issues</h1>
      <p>This is the issues page. Here, you can list all issues related to projects, options to add, resolve, or update them.</p>
    </div>
  );
};

export default Issues;
